/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground, Props } from "docz";
import Table from "../src/index";

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "table"
    }}>{`Table`}</h1>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <Props of={Table} mdxType="Props" />
    <h2 {...{
      "id": "basic-usage"
    }}>{`Basic usage`}</h2>
    <Playground __position={1} __code={'<Table
  rowKey="key"
  columns={[
    {
      title: 'Name',
      dataIndex: 'name',
      width: 200,
    },
    {
      title: 'Age',
      dataIndex: 'age',
      width: 200,
    },
    {
      title: 'Address',
      children: [
        {
          title: '公司地址',
          dataIndex: 'address1',
          width: 200,
        },
        {
          title: '家庭地址',
          dataIndex: 'address2',
          width: 200,
          children: [
            {
              title: '家庭地址1',
              dataIndex: 'address3',
              width: 200,
            },
            {
              title: '家庭地址2',
